import React, {useState, useEffect} from 'react';
import Time from './time';
import './HomePage.css'


const AppMain = () => {
    
    const [mounted, setMounted]=useState(false);

    useEffect(()=>{
        setMounted(true);
        return()=>{setMounted(false)}
    },[mounted])


    return ( 
        <div className="appMain">
            <h1 className="mainHeader">Software<div style={{color: "red"}}>Developer</div>
            </h1>
            <div className="clockContainer">
                <div className="cityClock">
                    <div className="city">Tokyo</div>
                    <Time mount={mounted} timeZone={32400}/>
                </div>
                <div className="cityClock">
                    <div className="city">LosAngeles</div>
                    <Time mount={mounted} timeZone={"LA"}/>
                </div>
                <div className="cityClock">
                    <div className="city">London</div>
                    <Time mount={mounted}timeZone={3600}/>
                </div>
            </div>
        </div>  
            );
}
 
export default AppMain;
